import React from 'react';
import {Card} from 'react-bootstrap'

const CardPic = props => {

    return(

        <div style={{position : 'relative'}}>

        <Card className="bg-dark text-white text-center justify-content-center align-items-center position-absolute" style={props.style} key={props.id}>

            <Card.Img src={props.image} alt={props.title} style={styles.imageContainer}/>

         </Card>


         <Card className="bg-dark text-white text-center align-items-center justify-content-center position-absolute" style={styles.imageContainer} style={props.style} key={props.id}>
                <Card.Body className="d-flex flex-column align-items-center justify-content-around">
                    <div>
                        <Card.Title>
                            {props.title}
                        </Card.Title>
                        <Card.Subtitle >LANGUAGES HERE</Card.Subtitle>
                    </div>
                    <Card.Text>
                        {props.description}
                    </Card.Text>
                    <div>
                        <Card.Link href={props.github}>Code</Card.Link>
                        <Card.Link href={props.demo}>Demo</Card.Link>
                    </div>
                 </Card.Body>
         </Card>





         </div>
    )
}


// <Card.ImgOverlay className="text-center d-flex flex-column justify-content-center">
// <Card.Title>{props.title}</Card.Title>
// <Card.Text>
// {props.description}
// </Card.Text>
// </Card.ImgOverlay>

const styles={
    imageContainer: {
        width: '100%',
        height: '100%',
        boxShadow: '0 8px 6px -6px black',
        borderRadius: '55px 55px 55px 55px',
        position: 'absolute'
    },
  cardsContainer: {

  }

}

export default CardPic;
